import React from "react";
import "./App.css";

function App() {
  const [formData, setFormData] = React.useState("");

  function formValue(e) {
    const { value } = e.target;
    setFormData(value);
    // console.log(value);
  }
  return (
    <div>
      <h1>How fast do you type?</h1>
      <textarea value={formData} onChange={formValue} />
      <h4>TIme Remaining: 5 seconds</h4>
      <button>Start Game</button>
      <h1>Word Count: 16</h1>
    </div>
  );
}

export default App;
